DROP TABLE IF EXISTS `pro_engineering_info`;
CREATE TABLE `pro_engineering_info` (
  `engin_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '工程ID',
  `project_id` bigint(20) NOT NULL COMMENT '项目ID',
  `final_id` bigint(20) NOT NULL COMMENT '最终项目ID',
  `main_tag` tinyint(4) NOT NULL COMMENT '主工程标识，0-是，1-否',
  `sort` int(11) DEFAULT NULL COMMENT '序号',
  `engin_name` varchar(64) NOT NULL COMMENT '工程名称',
  `total_money` decimal(10,2) NOT NULL COMMENT '项目总投资（万元',
  `line_total` decimal(10,2) DEFAULT NULL COMMENT '线路总长（千米）',
  `cable` decimal(10,2) DEFAULT NULL COMMENT '电缆长度(千米)',
  `air_wire` decimal(10,2) DEFAULT NULL COMMENT '架空线路长度（千米）',
  `mid_switchgear` int(11) DEFAULT NULL COMMENT '中压开关柜面数',
  `branch_box` int(11) DEFAULT NULL COMMENT '电缆分支箱台数',
  `column_switch` int(11) DEFAULT NULL COMMENT '柱上开关台数',
  `pipe` decimal(10,2) DEFAULT NULL COMMENT '电缆沟、管长度(千米)',
  `switchyard` int(11) DEFAULT NULL COMMENT '开关站座数',
  `transformer` int(11) DEFAULT NULL COMMENT '配电变压器台数',
  `capacity` decimal(10,2) DEFAULT NULL COMMENT '容量（千伏安）',
  `zone_area` int(11) DEFAULT NULL COMMENT '台区个数',
  `distribution_station` int(11) DEFAULT NULL COMMENT '配电站座数',
  `low_line` decimal(10,2) DEFAULT NULL COMMENT '低压线长度（千米）',
  `low_switchgear` int(11) DEFAULT NULL COMMENT '低压开关柜面数',
  `svg` decimal(10,2) DEFAULT NULL COMMENT '无功补偿（千乏）',
  `power_meter` int(11) DEFAULT NULL COMMENT '电能表（只）',
  `prod_time_plan` varchar(16) DEFAULT NULL COMMENT '计划投产时间:yyyy-MM-dd',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`engin_id`)
) ENGINE=InnoDB AUTO_INCREMENT=464 DEFAULT CHARSET=utf8 COMMENT='项目工程信息表';

