DROP TABLE IF EXISTS `pro_project_info`;
CREATE TABLE `pro_project_info` (
  `project_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '项目ID',
  `project_no` varchar(32) NOT NULL COMMENT '项目编码',
  `project_name` varchar(64) NOT NULL COMMENT '项目名称',
  `policy_level` varchar(32) DEFAULT NULL COMMENT '决策级别',
  `app_dept` varchar(32) DEFAULT NULL COMMENT '申请部门',
  `build_dept` varchar(32) DEFAULT NULL COMMENT '建设单位',
  `second_dept` varchar(32) DEFAULT NULL COMMENT '二级单位',
  `area_code` varchar(8) NOT NULL COMMENT '所属区域编码',
  `area_name` varchar(64) NOT NULL COMMENT '所属地区',
  `city_name` varchar(32) NOT NULL COMMENT '所属地市',
  `region_name` varchar(32) NOT NULL COMMENT '所属县区',
  `build_nature` varchar(32) DEFAULT NULL COMMENT '建设性质',
  `total_money` decimal(10,2) NOT NULL COMMENT '项目总投资（万元',
  `invest_year_plan` decimal(10,2) NOT NULL COMMENT '年投资计划（万元）',
  `first_quarter` decimal(10,2) NOT NULL COMMENT '第一季度投资（万元）',
  `second_quarter` decimal(10,2) NOT NULL COMMENT '第二季度投资（万元）',
  `third_quarter` decimal(10,2) NOT NULL COMMENT '第三季度投资（万元）',
  `fourth_quarter` decimal(10,2) NOT NULL COMMENT '第四季度投资（万元）',
  `prod_time_plan` varchar(16) DEFAULT NULL COMMENT '计划投产时间:yyyy-MM-dd',
  `fixed_time_plan` varchar(16) DEFAULT NULL COMMENT '暂估转固时间',
  `settle_time` varchar(16) DEFAULT NULL COMMENT '结算时间',
  `final_time` varchar(16) DEFAULT NULL COMMENT '决算时间',
  `fixed_time` varchar(16) DEFAULT NULL COMMENT '正式转固时间',
  `surplus_funds` tinyint(4) NOT NULL COMMENT '13年中央农网结余资金，0-是，1-否',
  `upgrading_project` tinyint(4) NOT NULL COMMENT '贫困地区农网改造升级专项，0-是，1-否',
  `town_project` tinyint(4) NOT NULL COMMENT '小城镇、中心村项目，0-是，1-否',
  `special_funds` tinyint(4) NOT NULL COMMENT '专项财政资金类别，0-是，1-否',
  `governance_project` tinyint(4) NOT NULL COMMENT '低电压专项治理项目，0-是，1-否',
  `eliminate_transform` tinyint(4) NOT NULL COMMENT '农村淘汰型户表改造，0-是，1-否',
  `alleviation_project` tinyint(4) NOT NULL COMMENT '易地扶贫工程，0-是，1-否',
  `poor_villages` tinyint(4) NOT NULL COMMENT '贫困村通动力电，0-是，1-否',
  `extreme_poverty` tinyint(4) NOT NULL COMMENT '极贫乡项目，0-是，1-否',
  `busi_extend` tinyint(4) NOT NULL COMMENT '业扩延伸，0-是，1-否',
  `send_out` tinyint(4) NOT NULL COMMENT '变电站送出，0-是，1-否',
  `project_type` tinyint(4) NOT NULL COMMENT '项目类型，1-可研，2-施设',
  `source_type` tinyint(4) NOT NULL COMMENT '来源类型，1-同步，2-本地创建',
  `build_id` bigint(20) DEFAULT NULL COMMENT '施设项目ID',
  `stage` varchar(4) NOT NULL COMMENT '阶段类型，1-可研，2-施设，3-变更，4-竣设',
  `stage_name` varchar(64) NOT NULL COMMENT '阶段名称',
  `status` tinyint(4) NOT NULL COMMENT '状态，1-任务待分配，2-项目开展中，3-成果待提交，4-项目评审中，5-完结',
  `org_id` bigint(20) DEFAULT NULL COMMENT '已分配单位ID',
  `org_name` varchar(64) DEFAULT NULL COMMENT '单位名称',
  `link_flag` tinyint(2) DEFAULT '0' COMMENT '是否被关联,0未被关联,1已关联',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `final_id` bigint(20) DEFAULT NULL COMMENT '关联的项目ID',
  PRIMARY KEY (`project_id`),
  UNIQUE KEY `UNQ_PROJECT_NO` (`project_no`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10047121331321 DEFAULT CHARSET=utf8 COMMENT='项目信息表';

